import React from 'react';
import styled from 'styled-components';

const StyledButton = styled.button`
  background-color: #854CE6;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 7px;
  cursor: pointer;
  text-align:center; 
  font-size:18px

`;

function Button() {
  return <StyledButton>Create new post</StyledButton>;
}
export default Button;
